import React from "react";

const ProductItem = ({ product }) => {
  return (
    <div className="card card-body">
      <img
        style={{
          display: "block",
          margin: "0 auto 10px",
          maxHeight: "200px",
        }}
        className="img-fluid"
        alt="prdImg"
        src={product.photo}
      />
      <p>{product.name}</p>
      <h4 className="text-left"> $ {product.price} </h4>
      <button href="#" className="btn btn-outline-dark">
        Add to cart
      </button>
    </div>
  );
};

export default ProductItem;
